                    <div>
                        <img src="#" alt="#"/>
                        <img src="#" alt="#"/>
                        <img src="#" alt="#"/>
                    </div>
                </div>
                <div className="rightSide">
                    <img src={zurag} alt="#"/>
                </div>
            </div>
            <div className='menu2'>
                {tses.map((e) => {
                return(
                    <div>
                    <a className='dedMenu' href='#'>{e.title}</a>
                    </div>
                );
                })}
            </div>
            <div className="cardM">
                {card.map((e) => {
                return(
                    <div>{e.card}</div>
                );
                })}
            </div>
        </div>

    )
}
